1. Carteira de identidade (original e 3 cópias);
2. CPF (3cópias);
3. Título de eleitor e comprovação de quitação eleitoral (cópia);
4. Certidão de nascimento/casamento (cópia);
5. Certificado de reservista/alistamento militar, para candidatos do sexo masculino entre 18 a 45 anos (cópia);
6. Certificado de conclusão do ensino médio (original e cópia) ou diploma (original e cópia);
7. Declaração de conclusão do ensino médio (original), para candidatos cujo diploma ou certificado do ensino médio ainda não tenha sido expedido pela instituição de ensino válida por 30 dias;
8. Histórico escolar completo do Ensino Médio (original e cópia);
9. Três fotos 3×4 iguais;
10. Estrangeiros: passaporte, RNE, (válidos à data da matrícula) (original e 3 cópias) ;
11. Termo de tutela, se for o caso (cópia);
12. Formulário de matrícula preenchido (fornecido pela UENF no ato da matrícula);
13. Anexo 1 das Normas da Graduação: Termo de Ciência e Compromisso Discente, disponível na página principal da UENF (www.uenf.br).
14. Formulário de não acumulação de matrícula ativa em instituição pública de ensino superior conforme Lei nº 12.099/2009.
Obs.1. O candidato que, no ato da matrícula, não apresentar o histórico escolar completo do Ensino Médio ou documento similar de curso equivalente perderá o direito à matrícula na UENF;
Obs.2. O Histórico Escolar do Ensino Médio ficará retido e será devolvido posteriormente.

